import React from 'react';
import Navbar from './Navbar';
import ImageCard from './ImageCard';

// Import your image URLs or file paths
import image1 from '../images/image1.jpeg';
import image2 from '../images/image2.jpeg';
import image3 from './images/image3.jpeg';
import image4 from './images/image4.jpeg';
import image5 from '../images/image5.jpeg';

const Home = () => {
  const imageSet1 = [image1, image2, image3];
  const imageSet2 = [image4, image5, image1];

  return (
    <div className="home-container">
      <Navbar className="navvv" />
      <h1 className="home-title">Welcome to VibeTribe</h1>
      <div className="image-card-container">
        <ImageCard images={imageSet1} />
        <ImageCard images={imageSet2} />
        {/* You can add more ImageCard components here */}
      </div>
    </div>
  );
};

export default Home;
